DROP TABLE IF EXISTS `sys_area`;
CREATE TABLE `sys_area` (
  `id` varchar(36) NOT NULL,
  `parent_id` varchar(36) NOT NULL,
  `area_code` varchar(50) NOT NULL,
  `area_name` varchar(256) NOT NULL,
  `sn` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

