-- ----------------------------
-- Table structure for `sys_backup`
-- ----------------------------
DROP TABLE IF EXISTS `sys_backup`;
CREATE TABLE `sys_backup` (
  `id` varchar(32) NOT NULL,
  `file_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '文件备份名',
  `backup_time` datetime DEFAULT NULL COMMENT '文件备份时间',
  `path` varchar(100) DEFAULT NULL COMMENT '备份文件路径',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

