-- ----------------------------
-- Table structure for `sys_file`
-- ----------------------------
DROP TABLE IF EXISTS `sys_file`;
CREATE TABLE `sys_file` (
  `id` varchar(36) NOT NULL,
  `folder_id` varchar(255) DEFAULT NULL COMMENT '文件夹',
  `file_name` varchar(256) NOT NULL COMMENT '文件名',
  `descn` varchar(256) DEFAULT NULL COMMENT '描述',
  `path` varchar(256) DEFAULT NULL COMMENT '文件路径',
  `type` varchar(200) DEFAULT NULL COMMENT '文件类型',
  `extension` varchar(200) DEFAULT NULL COMMENT '扩展名',
  `size` bigint(20) DEFAULT NULL COMMENT '文件大小',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `ref_id` varchar(32) DEFAULT NULL COMMENT '对象主键',
  `ref_obj` varchar(100) DEFAULT NULL COMMENT '引用对象',
  `user_id` varchar(32) DEFAULT NULL COMMENT '上传人ID',
  `username` varchar(32) DEFAULT NULL COMMENT '上传人名称',
  `duration` varchar(10) DEFAULT NULL COMMENT '视频文件时长',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='文件';

