  `name` varchar(128) NOT NULL COMMENT '文件夹名称',
  `descn` varchar(256) DEFAULT NULL COMMENT '描述',
  `user_id` varchar(36) DEFAULT NULL COMMENT '所属用户',
  `sn` int(11) DEFAULT NULL COMMENT '排序',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='文件夹';

