-- Table structure for `sys_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `id` varchar(36) NOT NULL,
  `operation` varchar(50) DEFAULT NULL COMMENT '操作',
  `oper_content` text COMMENT '操作内容',
  `user_id` varchar(36) DEFAULT NULL COMMENT '操作人账号',
  `username` varchar(255) DEFAULT NULL COMMENT '操作人',
  `user_agent` varchar(256) DEFAULT NULL COMMENT '客户端',
  `IP` varchar(100) DEFAULT NULL COMMENT 'IP',
  `oper_date` datetime DEFAULT NULL COMMENT '操作日期',
  PRIMARY KEY (`id`)
